import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState(null);


  useEffect(() => {
    axios.get("https://api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=721e6d30945061e57c30f65c44877cf8")
      .then(response => {
        console.log(response.data.results);
        setMovies(response.data.results);
      })
  }, [])
  return movies !== null ? (
    <div className="App">
     <ul>
       {
         movies.map((item) => {
         return <li>{item.original_title}</li>
         })
       }
     </ul>

    </div>
  ) : (
      <p>Pas de data</p>
    )
}

export default App;
